// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

import "./AccessControl.sol";
import "./DataUsageSmartContract.sol";
import "./AgreementSmartContract.sol";
import "./LogSmartContract.sol";

contract Verification is AccessControl {

    enum Operations{
        read,
        write,
        transfer
    }

    DataUsageSmartContract private dataUsageSmartContract;
    AgreementSmartContract private agreementSmartContract;
    LogSmartContract private logSmartContract;

    uint[] private violators;   // Array to store the IDs of the actors that violated the agreements

    event ActorFlaggedAsViolator(uint _actor, string _violationMessage);

    constructor(
        address _dataUsageSmartContractAddress,
        address _agreementSmartContractAddress,
        address _logSmartContractAddress
    ) {
        require(_dataUsageSmartContractAddress != address(0), "Invalid DataUsageSmartContract address.");
        require(_agreementSmartContractAddress != address(0), "Invalid AgreementSmartContract address.");
        require(_logSmartContractAddress != address(0), "Invalid LogSmartContract address.");

        dataUsageSmartContract = DataUsageSmartContract(_dataUsageSmartContractAddress);
        agreementSmartContract = AgreementSmartContract(_agreementSmartContractAddress);
        logSmartContract = LogSmartContract(_logSmartContractAddress);
    }

    function verifyCompliance() public onlyOwner {
        uint[] memory logKeys = logSmartContract.getLogKeys();
        uint[] memory consentKeys = agreementSmartContract.getConsentKeys();

        for (uint i = 0; i < logKeys.length; i++) {
             uint logKeyTsUser = logKeys[i];

            LogSmartContract.Log memory log = logSmartContract.getLogByKey(logKeyTsUser);

           for (uint j = 0; j < consentKeys.length; j++) {
                uint consentKeyIsActor = consentKeys[j];

                if (logKeyTsUser != consentKeyIsActor) {
                    AgreementSmartContract.Consent memory consent = agreementSmartContract.getConsentByKey(consentKeyIsActor);
                    DataUsageSmartContract.DataUsage memory dataUsage = dataUsageSmartContract.getDataUsageByKey(logKeyTsUser);

                    if (!consent.isConsented || log.actorId == consent.userId) {
                        violators.push(log.actorId);
                        emit ActorFlaggedAsViolator(log.actorId, "Consent is false");
                        continue;
                    }

                    bool isViolation = false;
                    if(uint(log.operations) != uint(dataUsage.operations)) {
                        isViolation = true;
                        emit ActorFlaggedAsViolator(log.actorId, "Operation performed is different");
                    } 

                    if (!isViolation) {
                            bytes32 logData = log.processedPersonalDatas;
                            bytes32 consentData = dataUsage.processedPersonalDatas;
                            if (logData != consentData) {
                                isViolation = true;
                                emit ActorFlaggedAsViolator(log.actorId, "processed personal data doesnt match");
                            }     
                    }

                    if (isViolation) {
                        violators.push(log.actorId);
                        break;
                    }
                    emit ActorFlaggedAsViolator(log.actorId, "Actor's address matched succesfully");
                }
           }
        }
    }

    /** In the revised verifyCompliance function:
            1 - It first fetches the keys for logs and consents.
            2 - It iterates over the log keys and, within that loop, iterates over the consent keys to find matches.
            3 - When a matching key is found, it performs the necessary verifications:
                    - Checks if the consent is given and the actor's ID matches.
                    - Compares the operations and processed personal data between the log and data usage entries.
            4 - If any discrepancies are found, it flags the actor as a violator.
    */

    function getViolators() public view returns (uint[] memory) {
        require(violators.length != 0, "violator is empty");
        return violators;
    }
}

contracts/LogSmartContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

import "./AccessControl.sol";
import "./DataUsageSmartContract.sol";

contract LogSmartContract is AccessControl {
    enum Operations{
        read,
        write,
        transfer
    }

    // Struct
    struct Log {
        uint actorId;                                    // below all data get from this dataUsage
        Operations operations;
        string serviceName;
        bytes32 processedPersonalDatas;
    }

   // Mapping
    mapping(uint => Log) private logs;                  // mapping logs <uint dataUsageId, Log theLog>
    uint[] private logKeys;                             // key  = Log.dataUsageId(uint)
    uint private logCounter = 0;                       // counter,(start from 0, ++ when add)

    // Function 

    function addLog(uint _actorId,Operations _operation, bytes32 _processPersonalData, string memory _serviceName) public onlyOwner {
        // Retrieve the associated DataUsage record to ensure it exists

        // Create the log record
        logs[_actorId] = Log({
            actorId: _actorId,
            operations: _operation,
            serviceName: _serviceName,
            processedPersonalDatas: _processPersonalData
        });

        logKeys.push(_actorId);
        logCounter++;

    }

    function getLogByKey(uint _dataActorId) public view returns (Log memory) {
        return logs[_dataActorId];
    }

    function getLogCounter() public view returns (uint) {
        return logCounter;
    }

    function getLogKeys() public view returns (uint[] memory) {
        return logKeys;
    }
}

contracts/AgreementSmartContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

import "./AccessControl.sol";
import "./DataUsageSmartContract.sol";

contract AgreementSmartContract is AccessControl {
    // Struct
    struct Consent {
        address purposeBlockAddress;        // = dataUsageSmartContractAddress, input
        uint userId;                        // input
        bool isConsented;                   // positive == true / negative == false, input
    }

    // Mapping
    mapping(uint => Consent) private consents;          // mapping consents <uint dataUsageId, Consent theConsent>
    uint[] private consentKeys;                         // key  = Consent.dataUsageId(uint)
    uint private consentsCounter = 0;                   // counter,(start from 0, ++ when add)


    // Function
    function addConsent(
        address _purposeBlockAddress,
        uint _userId,
        bool _isConsented
    ) public onlyOwner {

        consents[_userId] = Consent({
            purposeBlockAddress: _purposeBlockAddress,
            userId: _userId,
            isConsented: _isConsented
        });

        consentKeys.push(_userId);
        consentsCounter++;
    }

    function getConsentByKey(uint _dataUsageId) public view returns (Consent memory) {
        require(consents[_dataUsageId].userId != 0, "Consent does not exist.");
        return consents[_dataUsageId];
    }

    function getConsentCounter() public view returns (uint) {
        return consentsCounter;
    }

    function getConsentKeys() public view returns (uint[] memory) {
        return consentKeys;
    }

}

contracts/DataUsageSmartContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

import "./AccessControl.sol";

contract DataUsageSmartContract is AccessControl {

    // Struct
    enum Operation{
        read,
        write,
        transaction
    }
    
    struct DataUsage {
        string serviceName;
        string servicePurpose;
        uint actorId;                       // associated with the actor
        Operation operations;                //  == "read", "write", "transfer"(multiple)
        uint personalDataIds;             // associated with proccessedPersonalData(byte32)
        bytes32 processedPersonalDatas;
    }

    struct PersonalData {
        uint userId;
        string userName;
        string userAddress;
        string userTelephone;
    }
    
    // Mapping
     mapping(uint => DataUsage) private dataUsages;              // mapping dataUsages <uint dataUsageId, DataUsage theDataUsage>
    // mapping(bytes32 => DataUsage) public mapHashedDataUsage;
    // Store Key of Mappings
    
    uint private dataUsageCounter = 0;
    uint[] private actorIds;
    uint private personalDataCounter = 0;
    
    // event emitProcessorPersonalData(bytes32 processPersonalData);
    // ------ mapping : personalDatas ---- : add\get PersonalData functions are "public onlyOwner", getCounter function is "public view"
    function addPersonalData(
        uint _userId,
        string memory  _userName,
        string memory  _userAddress,
        string memory  _userTelephone
    ) public pure returns (bytes32) {
         // Initialize a variable to concatenate the personal data fields
        bytes memory dataToHash;

        dataToHash = abi.encodePacked(
            _userId,
            _userName,
            _userAddress,
            _userTelephone
        );
   
        // Generate the hash of the concatenated data 
        bytes32 processedPersonalData = keccak256(dataToHash);
        return processedPersonalData;
    }

    
    function getPersonalDataCounter() public view returns (uint) {
        return personalDataCounter;
    }

    // ------ mapping : dataUsages ---- : add function is "public onlyOwner", get functions are "public view"
    function addDataUsage(
        string memory _serviceName,
        string memory _servicePurpose,
        uint _actorId,
        Operation _operations,
        uint _personalDataIds,
        bytes32 _proceedPersonalData
    ) public onlyOwner {

        // Add the new DataUsage with the processedPersonalDatas included
        dataUsages[_actorId] = DataUsage({
            serviceName: _serviceName,
            servicePurpose: _servicePurpose,
            actorId: _actorId,
            operations: _operations,
            personalDataIds: _personalDataIds,
            processedPersonalDatas: _proceedPersonalData
        });

        // Update the counter for the data usage
        dataUsageCounter++;

    }


    function getDataUsageByKey(uint _actorConsentId) public view returns (DataUsage memory) {
        return dataUsages[_actorConsentId];
    }

    function getDataUsageCounter() public view returns (uint) {
        return dataUsageCounter;
    }
}

